svg.script:
// 
    var svgNS = "http://www.w3.org/2000/svg";
    var view;
    var rect;
    var svg;
    var wt, ht, xt, yt, w1, h1, x1, t1;
    var t;
    var timeout;

    function setup() {
        svg=document.getElementsByTagName("svg")[0];
        view=document.getElementById("layer3");
        rect=view.firstChild;
        while (!(rect instanceof SVGRectElement)) {
            rect=rect.nextSibling;
        }
        wt=w1=rect.width.baseVal.value;
        ht=h1=rect.height.baseVal.value;
        xt=x1=rect.x.baseVal.value;
        yt=y1=rect.y.baseVal.value;
        svg.setAttributeNS(null, "width", "100%");
        svg.setAttributeNS(null, "height", "100%");
        svg.setAttributeNS(null, "viewBox", ""+x1+" "+y1+" "+w1+" "+h1);
        svg.setAttributeNS(null, "preserveAspectRatio", "xMidYMax");
        document.documentElement.addEventListener('keydown',keydown,false);
    }

    function next() {
        var temp=rect.nextSibling;        
        while ( (temp!=null) && (! (temp instanceof SVGRectElement)) ) {
            temp=temp.nextSibling;
        }
        if (temp==null) {
            //console.log("Reached end.");
            return;
        }
        rect=temp;
        w1=rect.width.baseVal.value;
        h1=rect.height.baseVal.value;
        x1=rect.x.baseVal.value;
        y1=rect.y.baseVal.value;
        if (rect.hasAttributeNS(null,"onfocusin")) {
            var cmd=rect.getAttributeNS(null,"onfocusin");
            eval(cmd);
        }
        startMove();
    }

    function prev() {
        if (rect.hasAttributeNS(null,"onfocusout")) {
            var cmd=rect.getAttributeNS(null,"onfocusout");
            eval(cmd);
        }
        //console.log(rect);
        var temp=rect.previousSibling;        
        while ( (temp!=null) && (! (temp instanceof SVGRectElement)) ) {
            temp=temp.previousSibling;
        }
        if (temp==null) {
            //console.log("Reached start.");
            return;
        }
        rect=temp;
        w1=rect.width.baseVal.value;
        h1=rect.height.baseVal.value;
        x1=rect.x.baseVal.value;
        y1=rect.y.baseVal.value;
        startMove();
    }

    function startMove() {
        if (timeout!=null) {
          // This stops the animation:
          clearTimeout(timeout);
          timeout=null;
        }
        t=20;
        timeout=setTimeout(update,10);
    }

    function keydown(evt){
        //console.log(evt);
    	switch (evt.which){
            case 40:
                next();
	            break;
            case 38:
                prev();
	            break;
        }
    }

    function update(){

        wt=(w1+t*wt)/(t+1);
        ht=(h1+t*ht)/(t+1);
        xt=(x1+t*xt)/(t+1);
        yt=(y1+t*yt)/(t+1);
        svg.setAttributeNS(null, "viewBox", ""+xt+" "+yt+" "+wt+" "+ht);
        if (t>0) {
            t=t-1;
            timeout=setTimeout(update,10);
        }
    }

    function go1() {
        var tohide=document.getElementById("change1");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        tohide.setAttributeNS(null, "visibility", "hidden");
        var toshow=document.getElementById("change2");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");
    }

    function back1() {
        var tohide=document.getElementById("change2");
        tohide.setAttributeNS(null, "visibility", "hidden");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        var toshow=document.getElementById("change1");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");        
    }

    function go2() {
        var tohide=document.getElementById("change2");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        tohide.setAttributeNS(null, "visibility", "hidden");
        var toshow=document.getElementById("change3");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");
    }

    function back2() {
        var tohide=document.getElementById("change3");
        tohide.setAttributeNS(null, "visibility", "hidden");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        var toshow=document.getElementById("change2");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");        
    }


//

g.ns0:text:
\begin{center}
{\Large \bf \blue{Detecting vanishing
periodic billiard
trajectories in polygons}}
\end{center}

{\large \bf \blue{Idea 2:}} A \blue{translation surface} is a topological surface with an atlas of charts to the plane so that the transition functions are translations.

Translation surfaces can sometimes be used to answers to the \\ following questions:
\begin{enumerate}
\item Classify the orbit types of periodic billiard trajectories in a polygon $P_0$.
\end{enumerate}
For a real analytic path $t \mapsto P_t$,
\begin{enumerate}
\item[2.] Classify the orbit types so that $P_t$ lies in the orbit tile for \\ $0 \leq t < \epsilon$ for some $\epsilon>0$.
\item[3.] Classify the orbit types so that $P_t$ lies in the orbit tile for \\ $0 < t < \epsilon$ for some $\epsilon>0$.
\end{enumerate}

{\blue{This resolves:}} 
\begin{enumerate}
\item Classify the orbit types of periodic billiard trajectories in a polygon $P_0$.
\end{enumerate}

\begin{itemize}
\item $DP$ is a Eucidean cone surface.
\item There is a folding map $DP \to P$.
\item A periodic billiard trajectory in $P$ \\ lifts to a closed geodesic in $DP$.
\item Closed geodesics on $DP$ have \\ trivial rotational holonomy.
\end{itemize}

Let $DP^\ast$ denote the double of $P$ with its cone singularities removed. Rotational holonomy gives a group homomophism
\vspace{-1.5em}

$$\hol:\pi_1(DP^\ast) \to \R/2\pi \Z.$$
\vspace{-1.5em}

The cover of $DP^\ast$ \\ associated to $\ker(\hol)$ \\ is the minimal \\
translation surface \\ cover.

{\bf \color{Purple} Remarks:} 
\begin{itemize}
\item The cylinders can be arranged to be assymptotically horizontal by rotating $S_t$ uniformly.
\item The homotopy classes can be made to converge by choosing basepoints appropriately.
\item Cylinders whose width functions are $w(t)=c t^k+O(t^{k+1})$ 
for $k>1$ can be detected by successively rotating and stretching $k$ times.
\end{itemize}
